FeedPackage.ReleaseNotes:
New Features • ODataLib supports write & read async headers & payload. • OData Client supports model reference. • OData Client supports using enum in query options & operation parameter. • Improves the API of OData client for server-side paging support. Sample: NorthwindEntities ctx = new NorthwindEntities( new Uri(@"http://services.odata.org/V4/Northwind/Northwind.svc/")); var customers = ctx.Customers.GetAllPages(); // automatically get all pages of the Customers entity set foreach (var customer in customers) { Console.WriteLine(customer.CustomerID); }
• ODataUriParser supports more type for ‘cast’ in $filter. • OData Client supports new async API in .NET 4.0 format. Sample: var customers = await ctx.Customers.ExecuteAsync();
Bug Fixs • Fix a bug for top level dynamic property payload don’t have @odata.type annotation. • Fix a bug for Core annotation is not written in full namespace. For example term value will be “Org.OData.Core.V1.Description” instead of “Core.Description”.

FeedPackage.Description:
Contains the necessary SMO dependencies to allow execution of full client-side SQL scripts (eg. containing the GO command) to be executed from .NET.

Such scripts can be executed from within Management Studio but will fail when executed through ADO.NET.  This package contains the dependencies to allow that to happen.

Example usage:

public static void ExecuteSqlScript(SqlConnection conn, string script)
{
   var serverConnection = new Microsoft.SqlServer.Management.Common.ServerConnection(conn);
   var server = new Microsoft.SqlServer.Management.Smo.Server(serverConnection);
   server.ConnectionContext.ExecuteNonQuery(script);
}

PS. Anyone can download Sql Server Express (for free!) and copy these assemblies from the installation folder, but having a simple package just saves so much pain.
